<?php

namespace Api\Admin;

use App\Model\Task;
use HyperfTest\LoginTrait;
use HyperfTest\TestCase;
use HyperfTest\TestDto\BaseDto;

class UploadTest extends TestCase
{
    use LoginTrait;

    public function testImageUpload()
    {
        $this->adminLogin();

        $text = "data:image/png;base64,";

        $response = $this->post('/admin/upload/image', [
            'size' => 102400,
            'width' => 500,
            'height' => 500,
            'title' => '图片名称',
            'content' => $text
        ]);

        $this->assertApiSuccess($response);

        $response->build(new BaseDto([
            'project' => ['admin'],
            'name' => '上传图片',
            'category' => '公共分类',
            'params' => [],
            'desc' => '',
            'request' => [
                'size' => '图片大小',
                'width' => '尺寸，宽度',
                'height' => '尺寸，高度',
                'title' => '图片名称',
                'content' => 'base64内容',
            ],
            'request_except' => [],
            'response' => [
                'image' => '图片地址，需要自行拼接 域名 + /api/images/ 作为前缀',
            ],
        ]));
    }

}
